\begin{tikzpicture}
				[
					shorten >= 1pt,
					node distance=2.5cm,
					>=stealth,
					initial text=,
				]
				\tikzstyle{every state} = [circle, very thick, draw=orange!50, fill=orange!25]
				\tikzstyle{gate} = [rectangle, very thick, draw=blue!50, fill=blue!25]
				\node[state] (x0) {$\mathbold{x}_t$};
				\node[gate] (i0) [above of=x0] {$\mathbold{i}_t$};
				\node[state] (s0) [above of=i0] {$\mathbold{s}_t$};
				\node[state] (h0) [above of=s0] {$\mathbold{h}_t$};
				\node[gate] (f0) [right of=s0] {$\mathbold{f}_t$};
				\node[state] (z0) [below of=f0] {$\mathbold{z}_t$};
				\node[gate] (o0) [above of=h0] {$\mathbold{o}_t$};
				\node[state] (u0) [above of=o0] {$\mathbold{u}_t$};
				\node[state] (s1) [right of=f0] {$\mathbold{s}_{t+1}$};
				\node[state] (h1) [above of=s1] {$\mathbold{h}_{t+1}$};
				\node[gate] (f1) [right of=s1] {$\mathbold{f}_{t+1}$};
				\node[state] (z1) [below of=f1] {$\mathbold{z}_{t+1}$};
				\node[gate] (i1) [below of=s1] {$\mathbold{i}_{t+1}$};
				\node[state] (x1) [below of=i1] {$\mathbold{x}_{t+1}$};
				\node[gate] (o1) [above of=h1] {$\mathbold{o}_{t+1}$};
				\node[state] (u1) [above of=o1] {$\mathbold{u}_{t+1}$};
				\node[] (p0) [left of=s0] {};
				\node[] (p1) [left of=p0] {};
				\path[->, very thick]
					(x0) edge node [above, midway] {} (i0)
					(i0) edge node [above, midway] {} (s0)
					(s0) edge node [above, midway] {} (h0)
					(h0) edge node [above, midway] {} (o0)
					(o0) edge node [above, midway] {} (u0)
					(f0) edge[dotted] node [above, midway] {} (s1)
					(x1) edge node [above, midway] {} (i1)
					(i1) edge node [above, midway] {} (s1)
					(s1) edge node [above, midway] {} (h1)
					(h1) edge node [above, midway] {} (o1)
					(o1) edge node [above, midway] {} (u1)
					(h0) edge[dotted] node [above, midway] {} (h1)
					(h0) edge[bend right=30] node [above, midway] {} (i0)
					(h0) edge[] node [above, midway] {} (f0)
					(h0) edge[] node [above, midway] {} (z0)
					(x0) edge node [above, midway] {} (z0)
					(i0) edge[dotted] node [above, midway] {} (s1)
					(z0) edge[dotted] node [above, midway] {} (s1)
					(h1) edge[] node [above, midway] {} (f1)
					(h0) edge[dotted] node [above, midway] {} (s1)
					(h1) edge[, bend right=30] node [above, midway] {} (i1)
					(x0) edge[bend left=30] node [above, midway] {} (o0)
					(x0) edge node [above, midway] {} (f0)
					(x1) edge[bend left=30] node [above, midway] {} (o1)
					(x1) edge node [above, midway] {} (f1)
					(x1) edge node [above, midway] {} (z1)
					(h1) edge node [above, midway] {} (z1)
				;
			\end{tikzpicture}
